import colors from './colors';

export default {
  ctaBorder: `1px solid ${colors.border1}`,
  ctaBorder2: `1px solid ${colors.border2}`,
  ctaBorder3: `1px solid ${colors.border3}`,
  contentBorder: `1px solid ${colors.background2}`,
};
